import { useRef, useState } from "react";
import "../css/price-range.css";

const PriceRange = () => {
  const [value, setValue] = useState({ start: 5, end: 100 });
  const [startPos, setStartPos] = useState(0);
  const ref = useRef();
  const increaseStart = (e) => {
    console.log("moved");
    setStartPos(startPos + 1);
    ref.current.style.left = startPos + "%";
    let newValue = value;
    newValue.start += 1;
    setValue(newValue);
  };

  return (
    <div className="d-flex">
      <input className="range1" type="range" id="vol" name="vol" min="0" max="50" />
      <input className="range2" type="range" id="vol" value="0" name="vol" min="0" max="50" />
    </div>
  );
};

export default PriceRange;
